int binarySearch(u64 *nums, int numsSize, u64 target)
{
    int left = 0;
    int right = numsSize;
    int mid;
    
    if (target >=  nums[numsSize-1]){
        return right-1;
    }
    if (target < nums[1]){
        return 0;
    }
    
    while (left < right) {
        mid = left + (right - left) / 2;
        if (nums[mid] <= target && nums[mid+1] > target) {
            return mid; 
        } else if (nums[mid] < target) { 
            left = mid + 1;
        } else if (nums[mid] > target) { 
            right = mid;
        }
    }
    return -1; 
}